import { Col, Container, Row } from "react-bootstrap";
import Card from "react-bootstrap/Card";

function Presentation() {
  return (
    <>
      <Container>
        <Row className="aligh-items-center">
          <Col>
            <p>Welcome to my Portfolio</p>
          </Col>
          <Col></Col>
        </Row>
      </Container>
    </>
  );
}

export default Presentation;
